@pepecasso1 In my state in the US, you have to pass background checks and it takes a few months to get the license to own a gun.

I also had to take 2 day training/shooting classes for my concealed carry license.

Most other states are very lax. Mine is one of the most strict.

@pepecasso1 Being pro-gun is labeled as inherently bad by the far left, and idk why.

I agree 100% w needing to pass a few mental exams for a license.

Having and carrying a gun are a huge responsibility, and I‚Äôm proud to be able to defend my family should anything happen.
